  import React from 'react';
  import { mdx } from '@mdx-js/react';

  export const frontMatter = {
	title: 'vSphere 配置参考'
};
export const metadata = {
  "id": "rke/config-options/cloud-providers/vsphere/config-reference/_index",
  "title": "vSphere 配置参考",
  "description": "## 概述",
  "source": "@site/docs/rke/config-options/cloud-providers/vsphere/config-reference/_index.md",
  "permalink": "/docs/rke/config-options/cloud-providers/vsphere/config-reference/_index",
  "editUrl": "https://github.com/cnrancher/docs-rancher2/edit/master/docs/rke/config-options/cloud-providers/vsphere/config-reference/_index.md",
  "lastUpdatedBy": "Author",
  "lastUpdatedAt": 1539502055
};
  /* @jsx mdx */

export const rightToc = [{
  value: '概述',
  id: '概述',
  children: []
}, {
  value: 'vSphere 配置示例',
  id: 'vsphere-配置示例',
  children: []
}, {
  value: '可配置选项',
  id: '可配置选项',
  children: [{
    value: 'global',
    id: 'global',
    children: []
  }, {
    value: 'virtual_center',
    id: 'virtual_center',
    children: []
  }, {
    value: 'workspace',
    id: 'workspace',
    children: []
  }, {
    value: 'disk',
    id: 'disk',
    children: []
  }, {
    value: 'network',
    id: 'network',
    children: []
  }]
}];
const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {
  rightToc
};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <h2 {...{
      "id": "概述"
    }}>{`概述`}</h2>
    <p>{`本节显示了如何配置 vSphere 云提供商的示例。`}</p>
    <p>{`必须启用 vSphere 云提供商以允许动态供应卷。`}</p>
    <p>{`有关在 vSphere 上部署 Kubernetes 集群的更多详细信息，请参阅 `}<a parentName="p" {...{
        "href": "https://cloud-provider-vsphere.sigs.k8s.io/tutorials/kubernetes-on-vsphere-with-kubeadm.html"
      }}>{`官方云提供商文档`}</a>{`。`}</p>
    <blockquote>
      <p parentName="blockquote"><strong parentName="p">{`说明：`}</strong>{`本文档反映了 Kubernetes v1.9 中引入的新 vSphere Cloud Provider 配置模式，与之前的版本有所不同。`}</p>
    </blockquote>
    <h2 {...{
      "id": "vsphere-配置示例"
    }}>{`vSphere 配置示例`}</h2>
    <p>{`已知以下信息：`}</p>
    <ul>
      <li parentName="ul">{`集群中的虚拟机运行在同一个数据中心`}<inlineCode parentName="li">{`us-west-1`}</inlineCode>{`，由 vCenter`}<inlineCode parentName="li">{`vc.example.com`}</inlineCode>{`管理。`}</li>
      <li parentName="ul">{`vCenter 有一个用户`}<inlineCode parentName="li">{`provisioner`}</inlineCode>{`，密码`}<inlineCode parentName="li">{`secret`}</inlineCode>{`，并分配了所需的角色。`}</li>
      <li parentName="ul">{`vCenter 有一个名为`}<inlineCode parentName="li">{`ds-1`}</inlineCode>{`的数据存储，应该用来存储卷的 VMDK。`}</li>
      <li parentName="ul">{`vCenter 中存在一个`}<inlineCode parentName="li">{`vm/kubernetes`}</inlineCode>{`文件夹。`}</li>
    </ul>
    <p>{`那么，提供商的相应配置如下：`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-yaml"
      }}>{`(...)
cloud_provider:
  name: vsphere
  vsphereCloudProvider:
    virtual_center:
      vc.example.com:
        user: provisioner
        password: secret
        port: 443
        datacenters: /eu-west-1
    workspace:
      server: vc.example.com
      folder: /eu-west-1/folder/myvmfolder
      default-datastore: /eu-west-1/datastore/ds-1
      datacenter: /eu-west-1
      resourcepool-path: /eu-west-1/host/hn1/resources/myresourcepool

`}</code></pre>
    <h2 {...{
      "id": "可配置选项"
    }}>{`可配置选项`}</h2>
    <p>{`vSphere 配置选项分为 5 大类：`}</p>
    <ul>
      <li parentName="ul"><a parentName="li" {...{
          "href": "#global"
        }}>{`global`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "#virtual_center"
        }}>{`virtual_center`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "#workspace"
        }}>{`workspace`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "#disk"
        }}>{`disk`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "#network"
        }}>{`network`}</a></li>
    </ul>
    <h3 {...{
      "id": "global"
    }}>{`global`}</h3>
    <p>{`全局选项的主要目的是能够定义一套通用的配置参数，除非在`}<inlineCode parentName="p">{`virtual_center`}</inlineCode>{`指令下明确定义，否则所有在`}<inlineCode parentName="p">{`virtual_center`}</inlineCode>{`指令下定义的 vCenters 都将继承这些参数。`}</p>
    <p>{`因此，`}<inlineCode parentName="p">{`global`}</inlineCode>{`指令接受与`}<inlineCode parentName="p">{`virtual_center`}</inlineCode>{`指令相同的配置选项。此外，它还接受一个只能在这里指定的单一参数：`}</p>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": "left"
          }}>{`全局选项`}</th>
          <th parentName="tr" {...{
            "align": "left"
          }}>{`类型`}</th>
          <th parentName="tr" {...{
            "align": "left"
          }}>{`是否必填`}</th>
          <th parentName="tr" {...{
            "align": "left"
          }}>{`描述`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}>{`insecure-flag`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`boolean`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`否`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`如果 vCenter/ESXi 使用自签名证书，则设置为`}<strong parentName="td">{`true`}</strong>{`。`}</td>
        </tr>
      </tbody>
    </table>
    <p><strong parentName="p">{`示例：`}</strong></p>
    <pre><code parentName="pre" {...{
        "className": "language-yaml"
      }}>{`(...)
    global:
      insecure-flag: true
`}</code></pre>
    <h3 {...{
      "id": "virtual_center"
    }}>{`virtual_center`}</h3>
    <p>{`此配置指令指定管理集群中节点的 vCenters。您必须至少定义一个 vCenter/ESXi 服务器。如果节点跨越多个 vCenters，则必须定义所有的 vCenters。`}</p>
    <p>{`通过在`}<inlineCode parentName="p">{`virtual_center`}</inlineCode>{`指令下添加一个新条目来定义每个 vCenter，并将 vCenter IP 或 FQDN 作为名称。必须为每个 vCenter 提供所有必要的参数，除非它们已经在`}<inlineCode parentName="p">{`global`}</inlineCode>{`指令下定义。`}</p>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": "left"
          }}>{`virtual_center 选项`}</th>
          <th parentName="tr" {...{
            "align": "left"
          }}>{`类型`}</th>
          <th parentName="tr" {...{
            "align": "left"
          }}>{`是否必填`}</th>
          <th parentName="tr" {...{
            "align": "left"
          }}>{`描述`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}>{`user`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`string`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`是`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`用于验证此服务器的 vCenter/ESXi 用户`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}>{`password`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`string`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`是`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`用户密码`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}>{`port`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`string`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`否`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`用于连接到该服务器的端口。默认使用 443 端口`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}>{`datacenters`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`string`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`是`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`集群节点运行的所有数据中心列表，通过逗号分隔。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}>{`soap-roundtrip-count`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`uint`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`否`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`向 vCenter 提出的 API 请求的往返次数（num retries = 值 - 1）。`}</td>
        </tr>
      </tbody>
    </table>
    <blockquote>
      <p parentName="blockquote">{`RKE 尚未支持以下附加选项（在 Kubernetes v1.11 中引入）。`}</p>
    </blockquote>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": "left"
          }}>{`virtual_center 选项`}</th>
          <th parentName="tr" {...{
            "align": "left"
          }}>{`类型`}</th>
          <th parentName="tr" {...{
            "align": "left"
          }}>{`是否必填`}</th>
          <th parentName="tr" {...{
            "align": "left"
          }}>{`描述`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}>{`secret-name`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`string`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`否`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`包含凭证密钥/值对的密钥资源的名称。可以代替用户/密码参数而指定`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}>{`secret-namespace`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`string`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`否`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`创建密钥资源所在的命名空间`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}>{`ca-file`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`string`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`否`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`用于验证 vCenter 证书的 CA 证书文件的路径`}</td>
        </tr>
      </tbody>
    </table>
    <p><strong parentName="p">{`示例：`}</strong></p>
    <pre><code parentName="pre" {...{
        "className": "language-yaml"
      }}>{`(...)
    virtual_center:
      172.158.111.1: {}  # This vCenter inherits all it's properties from global options
      172.158.110.2:     # All required options are set explicitly
        user: vc-user
        password: othersecret
        datacenters: us-west-2
`}</code></pre>
    <h3 {...{
      "id": "workspace"
    }}>{`workspace`}</h3>
    <p>{`此配置组指定如何在 vSphere 中创建卷的存储。
可使用以下配置选项。`}</p>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": "left"
          }}>{`workspace Options 选项`}</th>
          <th parentName="tr" {...{
            "align": "left"
          }}>{`类型`}</th>
          <th parentName="tr" {...{
            "align": "left"
          }}>{`是否必填`}</th>
          <th parentName="tr" {...{
            "align": "left"
          }}>{`描述`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}>{`server`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`string`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`是`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`应用于创建卷的 vCenter/ESXi 的 IP 或 FQDN。必须与`}<inlineCode parentName="td">{`virtual_center`}</inlineCode>{`指令中定义的 vCenters 之一相匹配`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}>{`datacenter`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`string`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`是`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`应用于创建卷的数据中心的名称。对于 ESXi，请输入`}<em parentName="td">{`ha-datacenter`}</em></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}>{`folder`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`string`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`是`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`用于创建用于卷供应的虚拟机的文件夹路径（相对于 vCenter 中的根文件夹），例如 "vm/kubernetes"。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}>{`default-datastore`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`string`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`否`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`如果在 PVC 的卷选项中既没有指定数据存储也没有指定存储策略，则要放置 VMDK 的默认数据存储的名称。如果数据存储位于存储文件夹中，或者是数据存储集群的成员，请指定完整路径。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}>{`resourcepool-path`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`string`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`否`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`资源池的绝对或相对路径，`}<a parentName="td" {...{
              "href": "https://vmware.github.io/vsphere-storage-for-kubernetes/documentation/policy-based-mgmt.html"
            }}>{`基于存储策略的供应`}</a>{`的虚拟机应在其中创建。如果指定了相对路径，则根据数据中心的`}<em parentName="td">{`host`}</em>{`文件夹进行解析。示例： `}<inlineCode parentName="td">{`/<dataCenter>(dataCenter) /<dataCenter>/host/<host或ClusterName>/Resources/<poolName>`}</inlineCode>{`、`}<inlineCode parentName="td">{`Resources/<poolName>`}</inlineCode>{`。对于独立的 ESXi，指定`}<inlineCode parentName="td">{`Resources`}</inlineCode>{`。`}</td>
        </tr>
      </tbody>
    </table>
    <p><strong parentName="p">{`示例：`}</strong></p>
    <pre><code parentName="pre" {...{
        "className": "language-yaml"
      }}>{`(...)
    workspace:
      server: 172.158.111.1 # virtual_center块中定义的vCenter的IP地址
      datacenter: eu-west-1
      folder: vm/kubernetes
      default-datastore: ds-1
`}</code></pre>
    <h3 {...{
      "id": "disk"
    }}>{`disk`}</h3>
    <p>{`disk 有以下配置选项：`}</p>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": "left"
          }}>{`disk 配置选项`}</th>
          <th parentName="tr" {...{
            "align": "left"
          }}>{`类型`}</th>
          <th parentName="tr" {...{
            "align": "left"
          }}>{`是否必填`}</th>
          <th parentName="tr" {...{
            "align": "left"
          }}>{`描述`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}>{`scsicontrollertype`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`string`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`否`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`将块存储连接到虚拟机时要使用的 SCSI controller 类型，必须是以下类型之一：`}<em parentName="td">{`lsilogic-sas`}</em>{`或`}<em parentName="td">{`pvscsi`}</em>{`，默认值为`}<em parentName="td">{`pvscsi`}</em>{`。`}</td>
        </tr>
      </tbody>
    </table>
    <h3 {...{
      "id": "network"
    }}>{`network`}</h3>
    <p>{`network 有以下配置选项：`}</p>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": "left"
          }}>{`disk 配置选项`}</th>
          <th parentName="tr" {...{
            "align": "left"
          }}>{`类型`}</th>
          <th parentName="tr" {...{
            "align": "left"
          }}>{`是否必填`}</th>
          <th parentName="tr" {...{
            "align": "left"
          }}>{`描述`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}>{`public-network`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`string`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`否`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`集群中的虚拟机所连接的公共`}<strong parentName="td">{`VM Network`}</strong>{`的名称。用于确定虚拟机的公共 IP 地址。`}</td>
        </tr>
      </tbody>
    </table>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
